{
  "swagger": "2.0",
  "info": {
    "description": "\n\nHeader -> api_key :  \n\n",
    "version": "1.0.0",
    "title": "E commerce"
  },
  "host": "127.0.0.1:8000",
  "basePath": "/api",
  "tags": [
    {
      "name": "User",
      "description": "All User Operations"
    }

  ],
  "paths": {
    "/auth/login": {
      "post": {
        "tags": [
          "User"
        ],
        "summary": "User Login",
        "operationId": "login",
        "produces": [
          "application/json"
        ],
        "security": [
          {
            "APIKeyHeader": []
          }
        ],
        "parameters": [
          {
            "name": "email",
            "in": "formData",
            "description": "Enter Email",
            "required": true,
            "type": "string"
          },
          {
            "name": "password",
            "in": "formData",
            "description": "password",
            "required": true,
            "type": "string"
          }

        ],
        "responses": {
          "200": {
            "description": "Data"
          }
        }
      }
    }



  },
  "securityDefinitions": {
    "APIKeyHeader": {
      "type": "apiKey",
      "in": "header",
      "name": "api-key"
    }
  },
  "definitions": {
    "user": {
      "type": "object",
      "properties": {
        "user_id": {
          "type": "number"
        },
        "name": {
          "type": "string"
        },
        "email": {
          "type": "string"
        }
      }
    }
  },
  "schemes": [
    "http",
    "https"
  ]
}
